import React, { useEffect, useState} from 'react'
import Footer from './components/Footer'
import Cookies from 'js-cookie'

const Contacts = () => {

    const [contactItem, setContactItem] = useState({items:null, loaded: false})
    const [Item, setItem] = useState([])
    const [query, setQuery] = useState()



    useEffect(()=>{
        // setCookies(Cookies.get('token'))
        console.log(Cookies.get('token'))
        fetch('http://localhost:5000/read-contacts',{
            method: 'GET',
            mode: 'cors',
            headers: {
                'Content-Type': 'application/x-www-form-urlencoded',
                'Access-Control-Allow-Origin': '*',
                'x-access-token': Cookies.get('token')
            }

        }).then(resp => resp.json())
        .then(items => {

                setContactItem({items: Object.values(items), loaded: true})

            // console.log()
            // setContactItem([Object.values(items)])
        })

    }, [query])

console.log(contactItem)
//    const contactInfo = contactItem.map((contactObj) => {
//         return <h1>{contactObj.name}</h1>
//     })

    // const testm = Item.map((as)=>{
    //     return console.log(as)
    // })

    var {items, loaded} = contactItem
    function clicks (id) {
        alert('id: ' + id + 'was clicked')
    }

    if(!loaded){
        return(
            <>
            <p>Loading...</p>
            </>
        )
    }else{
        return(

            <div className='app-bg'>
                <h3 className='title'>Contacts</h3>
                <ul>
                {contactItem.items.map(obj => (<li key={obj.id} onClick={()=> clicks(obj.id)}>{obj.name}</li>) )}
                </ul>



            <Footer />
            </div>
        )
    }

}

export default Contacts;
